  \"\",\n\t\t\"description\": \"NDFD posts new day 1-3 grid files 24 times per day.
  NDFD includes new day 4-7 grid files only for the issuances at 00 UTC, 06 UTC, 12
  UTC, 18 UTC, and 22 UTC. For the oceanic domain, grid files are posted at about
  20 minutes past the hour. NDFD adds a new forecast day (24 hours) once per day with
  the issuance at 22 UTC. Expired forecast grids are dropped throughout the day.rnrnWith
  this implementation, forecasts for these elements are available from NDFD in the
  following standard methods:rnrnGridded Binary Version 2 (GRIB2) files via Hypertext
  Transfer Protocol (HTTP) and File Transfer Protocol (FTP)rnExtensible Markup Language
  (XML) via Simple Object Access Protocol (SOAP)rnGraphics via web browser\",\n\t\t\"format\":
